import { bootstrapApplication } from '@angular/platform-browser';
import { provideRouter, Routes, withInMemoryScrolling } from '@angular/router';
import { AppComponent } from './app/app.component';

const routes: Routes = [
  { path: '', redirectTo: 'dashboard', pathMatch: 'full' },
  {
    path: 'dashboard',
    loadComponent: () =>
      import('./pages/dashboard.component').then(m => m.DashboardComponent),
    title: 'Dashboard'
  },
  {
    path: 'applications-features',
    loadComponent: () =>
      import('./pages/applications-features.component').then(m => m.ApplicationsFeaturesComponent),
    title: 'Applications & Features'
  },
  {
    path: 'groups',
    loadComponent: () =>
      import('./pages/groups.component').then(m => m.GroupsComponent),
    title: 'Groups'
  },
  {
    path: 'roles',
    loadComponent: () =>
      import('./pages/roles.component').then(m => m.RolesComponent),
    title: 'Roles'
  },
  {
    path: 'users',
    loadComponent: () =>
      import('./pages/users.component').then(m => m.UsersComponent),
    title: 'Users'
  },
  {
    path: 'templates',
    loadComponent: () =>
      import('./pages/templates.component').then(m => m.TemplatesComponent),
    title: 'Templates'
  },
  {
    path: 'audit-log',
    loadComponent: () =>
      import('./pages/audit-log.component').then(m => m.AuditLogComponent),
    title: 'Audit Log'
  },
  { path: '**', redirectTo: 'dashboard' }
];

bootstrapApplication(AppComponent, {
  providers: [
    provideRouter(routes, withInMemoryScrolling({ anchorScrolling: 'enabled' }))
  ]
}).catch(err => console.error(err));
